const molecules = [];
let selected = null;

const buildMolecules = () => {
    for (let i = 0; i < 1000; i++) {

        const molecule = [];

        for (let j = 0; j < 21; j ++) {

            const line = methyl900Data[i * 21 + j]
            const atom = {
                el: line[14],
                x: Number(line.substring(20, 28)),
                y: Number(line.substring(28, 36)),
                z: Number(line.substring(36, 44))
            };

            molecule.push(atom);
        }

        molecules.push(molecule);
    }
}

const updateText = () => {
    const conformDiv = document.getElementById("conformation");
    const orientDiv = document.getElementById("orientation");

    const conformText = results[selected][0] === "N/A" ? "--" : results[selected][0];
    const orientText = results[selected][1] === "N/A" ? "--" : results[selected][1];

    conformDiv.innerText = conformText;
    orientDiv.innerText = orientText;
}

const pickNew = () => {
    const firstLoad = (selected === null);
    selected = Math.floor(Math.random() * 1000);

    if (!firstLoad) {
        renderMolecule();
    }

    updateText();
}

buildMolecules()
pickNew()